 "Use the $ option after recording to define the authorship or the audio title.": "Utilice a opci\u00f3n & despois de gravar para definir o t\u00edtulo e a autor\u00eda.", 
 "%prog, the commandline version of eXe.\nUsage: %prog [options] input_file [output_file]\n\nTo show help:\n%prog -h": "%prog, a versi\u00f3n de eXe para li\u00f1a de comandos.\nUso: %prog [options] input_file [output_file]\n\nTo show help:\n%prog -h", 
 "SCORM Options (1.2 and 2004)": "Opci\u00f3ns SCORM (1.2 and 2004)", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text that are key to understanding the concepts. These will probably be verbs, nouns, and key adverbs. Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Si o seu obxectio \u00e9 avaliar a comprensi\u00f3n dos conceptos base ou a comprensi\u00f3n lectora  <\/dt>  <dd>    <p>  Escriba un resumo do concepto ou lectura suficientemente extenso para que a s\u00faa lonxitude sexa adecuada para avaliar o co\u00f1ecemento que se quere comprobar, pero suficientemente curto para non inducir fatiga. Menos dunha p\u00e1xina \u00e9 probablemente adecuado, pero debe considerar menos para estudantes novos ou principiantes.    <\/p>    <p>Selecciona palabras no texto que sexan claves para entender os conceptos. Estas ser\u00e1n probablemente verbos, sustantivos e adverbios clave. Elixe alternativas con unha resposta clara.    <\/p>  <\/dd>  <dt>Si a s\u00faa meta \u00e9 probar o co\u00f1ecemento de vocabulario  <\/dt>  <dd><p>Escriba un texto no que utilice o vocabulario correspondente ao dominio que quere avaliar. Este texto deber\u00eda ser coherente e ter unha unidade, ou unha lonxitude apropiada. Resalte as palabras importantes no texto. Escolla alternativas que non induzan a confusi\u00f3n.<\/p>  <\/dd>  <dt>Si o seu obxectivo \u00e9 avaliar a morfolox\u00eda ou a gram\u00e1tica::  <\/dt>  <dd>  <p>Escriba un texto considerando estes obxectivos. Este texto deber\u00eda ser coherente e ter unha unidade e unha lonxitude apropiada. Recorde que o obxectivo non \u00e9 o co\u00f1ecemento do vocabulario, e polo tanto os estudantes deben co\u00f1ecer xa o significado esencial das ra\u00edces dos termos utilizados.  <\/p>  <p>Resalte as palabras que queira avalar o texto. Proporcione alternativas coa mesma ra\u00edz, pero con diferentes sufixos. \u00c9 unha boa idea conseguir que un colega probe os exercicios para asegurarse de que non haxa sorpresas!  <\/p> <\/dd><\/dl>", 
