 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>O iDevice Wikipedia permite localizar contido existente en Wikipedia e descargar este contido a eXe. O iDevice Artigo da Wikipedia toma unha coipa do contido de ese momento. Os cambios na Wikipedia no actualizar\u00e1n o contido automaticamente en eXe, polo que \u00e9 preciso actualizala no futuro. Asimesmo, os cambios que se fagan en eXe non actualizar\u00e1n a Wikipedia. <\/p> <p>O contido da WIkipedia est\u00e1 protexido por unha licenza Creative Commons CompartirIgual 3.0.<\/p>", 
