 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Introduza unha URL RSS para a fonte RSS que queres engadir ao contido. As fontes son identificadas por inha icona pequena\n (normalmente como esta <img src=\"\/images\/feed-icon.png\" \/>) ou o texto \"RSS\". Premento na \n icona ou o texto amosarase a fonte RSS correctamente no seu navegador. Pode copiar e pegar a URL dentro do campo. Alternativamente, pode premer o bot\u00f3n dereito no v\u00ednculo ou icona e abrirase un men\u00fa; prema en COPIAR LOCALIZACI\u00d3N DA LIGAZ\u00d3N ou COPIAR ACCESO DIRECTOR Volva a eXe e peque o v\u00ednculo no campo URL do iDevice RSS e pulse o bot\u00f3n Subir. Isto extraer\u00e1 os t\u00edtulos da s\u00faa canle RSS e amosar\u00e1 como v\u00ednculos o contido. Dende aqu\u00ed podes editar os favoritos e agregar\n instruci\u00f3ns e informaci\u00f3n adicional da aprendizaxe.", 
