 "Subtitles": "Subt\u00edtulos", 
 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "A pesar de seren usados con maior frecuencia en situaci\u00f3ns formais de test, \nas Preguntas de selecci\u00f3n m\u00faltiple p\u00f3dense usar como unha ferramenta de test para estimular o pensamento e \na discusi\u00f3n sobre aqueles temas en que os estudantes que se poder\u00edan mostar un pouco reticentes a responder. \n \n\no dese\u00f1ar un test de Preguntas de selecci\u00f3n m\u00faltiple considere as seguintes cuesti\u00f3ns:\n<ul>\n<li> Sobre que resultados da aprendizaxe est\u00e1n incidindo as preguntas?<\/li>\n<li> Que capacidades intelectuais se est\u00e1n probando?<\/li>\n<li> Cales son as habilidades ling\u00fc\u00edsticas dos destinatarios?<\/li>\n<li>As cuesti\u00f3ns culturais e de x\u00e9nero<\/li>\n<li> Evite as estruturas sint\u00e1cticas e as estruturas das preguntas que podan ofrecer \n     pistas<\/li>\n<\/ul>\n ", 
