 "very easy": "moi doado", 
 "\n        <h2>Click The Elements in Order Game<\/h2>\n        <p>\n                This builds a Javascript game where the player has to click on a certain place on the main area according to the hint.  \n                When they click correctly the positive feedback will come and the game will advance.  When they click the wrong\n                area negative feedback will be shown.  When they click on the correct area an item can be revealed there.  A delay\n                can be set to make the item disappear if desired after a delay.\n        <\/p>\n\n        ": "\n        <h2>Xogo de facer clic por orde<\/h2>\n        <p>\n                Este iDevice constr\u00fae un xogo en Javascript no que o xogador ten que premer nun sitio determinado da \u00e1rea principal segundo a axuda.  \n                Cando se preme correctamente aparecer\u00e1 unha retroalimentaci\u00f3n positiva e avanzarase no xogo.  Cando se prema err\u00f3neamente\n                aparecer\u00e1 unha retroalimentaci\u00f3n.  Cando se prema a \u00e1rea correcta pode descubrirse o obxecto.  Pode\n                fixarse un retraso que faca que o obxecto desapareza tras ese tempo.\n        <\/p>\n\n        ", 
