 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>    What educational points are conveyed in the story<\/li>\n<li>    What preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>    Where the case study fits into the rest of the course<\/li>\n<li>    How the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Un caso de pr\u00e1ctico \u00e9 un iDevice que presenta aos estudantes unha simulaci\u00f3n que ten unha base educativa. Parte dunha situaci\u00f3n , xeralmente baseada na realidade, e pide aos estudantes que demostren ou describan que acci\u00f3n levar\u00edan a cabo para completar a tarefa e resolver a situaci\u00f3n. O caso pr\u00e1ctico permite aos estudantes aplicar os seus co\u00f1ecementos e experiencia propios para completar tarefas asignadas. Cando dese\u00f1a un caso pr\u00e1ctico considere o seguinte:<ul> \n<li>\tQue puntos educativos estar\u00e1n presentes na historia<\/li>\n<li>\tQue preparaci\u00f3n precisar\u00e1n facer os estudantes antes de traballar no caso pr\u00e1ctico<\/li>\n<li>\tOnde encaixa o caso pr\u00e1ctico dentro do resto do curso<\/li>\n<li>\tComo actuar\u00e1n rec\u00edprocamente os estudantes cos materiais e entre eles. Ex.\nno caso de realizarse na aula, poden crearse equipos para que traballen diferentes aspectos do caso, de ser as\u00ed, como se achegan as ideas ao resto da clase<\/li><\/ul>", 
